      "path": "src/store.ts",
      "content": "declare const require: any;
declare const process: any;
const fs = require('node:fs');
const crypto = require('node:crypto');

type Task = {
  id: string,
  title: string
};

class TaskStore {
  private tasks: Task[] = [];

  constructor(private filePath: string) {}

  load(): void {
    if (fs.existsSync(this.filePath)) {
      this.tasks = JSON.parse(fs.readFileSync(this.filePath, 'utf-8')) || [];
    }
  }

  save(): void {
    fs.writeFileSync(this.filePath, JSON.stringify(this.tasks, null, 2));
  }

  list(): Task[] {
    return this.tasks;
  }

  add(title: string): Task {
    const task = { id: crypto.randomUUID(), title };
    this.tasks.push(task);
    this.save();
    return task;
  }

  done(id: string): Task | null {
    const task = this.tasks.find(t => t.id === id);
    if (task) {
      // Assuming 'done' means marking the task as completed, but here we just return it.
      return task;
    }
    return null;
  }

  remove(id: string): Task | null {
    const index = this.tasks.findIndex(t => t.id === id);
    if (index !== -1) {
      const removedTask = this.tasks.splice(index, 1)[0];
      this.save();
      return removedTask;
    }
    return null;
  }
}

export { TaskStore };"
